import React from "react";
import Image from "./Image";
const Feed = (props) => {
    const arr = [{
        src:"./img1.jpg",
        name: "Image Name1",
        des: "Image Description1",
        owner: "Image Owner1"
    },
    {
        src:"./img2.jpg",
        name: "Image Name2",
        des: "Image Description2",
        owner: "Image Owner2"
    },
    {
        src:"./img3.jpg",
        name: "Image Name3",
        des: "Image Description3",
        owner: "Image Owner3"
    },
    {
        src:"./img4.jpg",
        name: "Image Name",
        des: "Image Description",
        owner: "Image Owner"
    }];
    return (
        <div>
            <Image>{arr}</Image>
        </div>
    );
}
export default Feed;
